INSERT INTO `concept_description` (`concept_description_id`, `concept_id`, `description`, `locale`, `creator`, `date_created`, `changed_by`, `date_changed`, `uuid`) VALUES
(49, 48, 'Pregnancy terminated by a spontaneous abortion.', 'en', 1, '2004-01-01 00:00:00', 1, '2012-10-09 21:18:04', '49FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(107, 108, 'A contraction of smooth muscle in the walls of the bronchi and bronchioles, causing narrowing of the lumen.', 'en', 1, '2004-01-01 00:00:00', 1, '2015-11-05 01:34:22', '107FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(110, 111, 'A disorder of digestive function characterized by discomfort or heartburn or nausea.', 'en', 1, '2004-01-01 00:00:00', 1, '2016-01-27 02:31:40', '110FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(120, 121, 'Muscular pain or tenderness, especially when diffuse and nonspecific.', 'en', 1, '2004-01-01 00:00:00', 1, '2015-11-05 01:37:39', '120FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(123, 124, 'Intestinal infection with amoebae.', 'en', 1, '2004-01-01 00:00:00', 1, NULL, '123FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(129, 130, 'An abnormal condition that results from infection of the placental site following delivery or abortion and is characterized in mild form by fever of not over 100.4?F (38.0?C) but may progress to a localized endometritis or spread through the uterine wall and develop into peritonitis or pass into the blood stream and produce septicemia.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:50:36', '129FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(139, 140, 'A contagious skin disease caused by a parasitic mite (Sarcoptes scabiei) and characterized by intense itching.', 'en', 1, '2004-01-01 00:00:00', 1, '2016-05-27 02:48:38', '139FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(154, 155, 'Any of various neurological disorders characterized by sudden recurring attacks of motor, sensory, or psychic malfunction with or without loss of consciousness or convulsive seizures.', 'en', 1, '2004-01-01 00:00:00', 1, '2016-04-17 01:27:03', '154FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(200, 199, 'A disease caused by infestation with parasitic worms.', 'en', 1, '2004-01-01 00:00:00', 1, '2013-10-31 13:56:07', '200FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(207, 206, 'Epileptic seizure of unspecified type.', 'en', 1, '2004-01-01 00:00:00', 1, '2015-12-31 16:48:48', '207FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(231, 230, 'Vaginal bleeding in a pregnant women after birth.', 'en', 1, '2004-01-01 00:00:00', 1, '2016-06-19 20:31:12', '231FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(460, 460, 'An abnormal excess accumulation of serous fluid in connective tissue or in a serous cavity.', 'en', 1, '2004-01-01 00:00:00', 1, '2016-07-30 02:08:39', '460FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(512, 512, 'DEF: Lesion of the skin. DESC: The history of the particular skin lesions is also important, including time and site of initial appearance, spread, change in appearance, and triggering factors. Visual inspection is the central evaluation tool; many skin diseases are diagnosed by the characteristic appearance or morphology of the lesions. REF: Merck Manual', 'en', 1, '2004-01-01 00:00:00', 1, '2016-04-27 14:18:52', '512FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(832, 832, 'Clinical finding of weight loss, less severe than the wasting syndrome.', 'en', 1, '2004-05-04 00:00:00', 1, '2015-12-31 16:58:52', '832FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(840, 840, 'The presence of blood or blood cells in the urine.', 'en', 1, '2004-05-04 00:00:00', 1, '2016-05-14 01:41:37', '840FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(882, 879, 'The sensation in the skin that encourages itching or scratching.', 'en', 1, '2004-05-05 00:00:00', 1, NULL, '882FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(895, 892, 'An acute contagious disease especially of children that is marked by low-grade fever and formation of vesicles and that is caused by a herpesvirus.', 'en', 1, '2004-06-02 00:00:00', 1, '2016-05-27 02:58:14', '895FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(927, 924, 'Antimalarial prophylactic and therapy.  Also being used for PCP treatment.', 'en', 1, '2004-07-23 00:00:00', 1, NULL, '927FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1002, 1000, 'Blood samples not separated into subtypes (RBC, WBC, Platelets)', 'en', 1, '2004-12-02 00:00:00', 1, '2013-07-31 15:15:15', '1002FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1003, 1001, 'Blood supernatent product after blood clots', 'en', 1, '2004-12-02 00:00:00', 1, '2014-05-16 15:25:29', '1003FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1004, 1002, 'Blood supernatent product, including clotting factors.', 'en', 1, '2004-12-02 00:00:00', 1, '2014-05-16 15:25:46', '1004FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(1006, 1004, 'Matter coughed up and usually ejected from the mouth, including saliva, foreign material, and substances such as mucus or phlegm, from the respiratory tract.', 'en', 1, '2004-12-02 00:00:00', 1, '2016-07-10 03:24:40', '1006FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
