(4501, 115835, 'Inflammation of the coverings of the brain and/or spinal cord, which consist of the PIA MATER; ARACHNOID; and DURA MATER. Infections (viral, bacterial, and fungal) are the most common causes of this condition, but subarachnoid hemorrhage (HEMORRHAGES, SUBARACHNOID), chemical irritation (chemical MENINGITIS), granulomatous conditions, neoplastic conditions (e.g., carcinomatous meningitis), and other inflammatory conditions may produce this syndrome. (From Joynt, Clinical Neurology, 1994, Ch24, p6)', 'en', 1, '2007-11-02 20:02:40', 1, '2016-05-27 20:34:04', '4501FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
(4639, 116128, 'A protozoan disease caused by four species of the genus PLASMODIUM (P. falciparum (MALARIA, FALCIPARUM), P. vivax (MALARIA, VIVAX), P. ovale, and P. malariae) and transmitted by the bite of an infected female mosquito of the genus Anopheles. Malaria is endemic in parts of Asia, Africa, Central and South America, Oceania, and certain Caribbean islands. It is characterized by extreme exhaustion associated with paroxysms of high fever, sweating, shaking chills, and anemia.', 'en', 1, '2007-11-02 19:28:08', 1, '2015-11-03 02:51:24', '4639FFFFFFFFFFFFFFFFFFFFFFFFFFFFFFFF'),
