('patient.defaultPatientIdentifierValidator', 'org.openmrs.patient.impl.LuhnIdentifierValidator', 'This property sets the default patient identifier validator.  The default validator is only used in a handful of (mostly legacy) instances.  For example, it\'s used to generate the isValidCheckDigit calculated column and to append the string \"(default)\" to the name of the default validator on the editPatientIdentifierType form.', '15ece7ae-fc08-4557-85a1-bdad316423d6', NULL, NULL, NULL, NULL, NULL, NULL),
