('patient.identifierPrefix', NULL, 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes \"... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';\".  Typically this value is either a percent sign (%) or empty.', '881b5f22-6d1f-4680-954b-b8e4c33af079', NULL, NULL, NULL, NULL, NULL, NULL),
('patient.identifierRegex', NULL, 'WARNING: Using this search property can cause a drop in mysql performance with large patient sets.  A MySQL regular expression for the patient identifier search strings.  The @SEARCH@ string is replaced at runtime with the user\'s search string.  An empty regex will cause a simply \'like\' sql search to be used. Example: ^0*@SEARCH@([A-Z]+-[0-9])?$', '2869d859-a2ac-48d1-aaa0-0470f84f2b2b', NULL, NULL, NULL, NULL, NULL, NULL),
('patient.identifierSearchPattern', NULL, 'If this is empty, the regex or suffix/prefix search is used.  Comma separated list of identifiers to check.  Allows for faster searching of multiple options rather than the slow regex. e.g. @SEARCH@,0@SEARCH@,@SEARCH-1@-@CHECKDIGIT@,0@SEARCH-1@-@CHECKDIGIT@ would turn a request for \"4127\" into a search for \"in (\'4127\',\'04127\',\'412-7\',\'0412-7\')\"', '97f39e07-b2f3-4687-846e-c3dc3953e46e', NULL, NULL, NULL, NULL, NULL, NULL),
('patient.identifierSuffix', NULL, 'This property is only used if patient.identifierRegex is empty.  The string here is prepended to the sql indentifier search string.  The sql becomes \"... where identifier like \'<PREFIX><QUERY STRING><SUFFIX>\';\".  Typically this value is either a percent sign (%) or empty.', '0a103be0-9f72-49d7-a225-1ebd9ce9f453', NULL, NULL, NULL, NULL, NULL, NULL),
