(1, 'Number of Visits', 'Number of visits in a given date range', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"9667a78e-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Visits</name>\n  <description>Number of visits in a given date range</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2019-05-19 07:56:33 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>Visit Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" retired=\"false\">\n          <name>Number of Visits</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Number_of_visits from visit v where v.date_started &gt;= :startDate and v.date_stopped &lt;= :endDate </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:33', 2, NULL, NULL, 0, NULL, NULL, NULL, '9667a78e-4881-11e7-a919-92ebcb67fe33'),
(2, 'Number of Admissions', 'Number of Admissions for a given location', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"d39509bc-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>Number of Admissions</name>\n  <description>Number of Admissions for a given location</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2019-05-19 07:56:34 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>location</name>\n      <label>Location</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>Admission Count</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>Number of Admissions</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select count(*) as Count from encounter e where e.encounter_type=(select encounter_type_id from encounter_type where uuid=&apos;e22e39fd-7db2-45e7-80f1-60fa0d5a4378&apos;) and e.location_id=:location and e.voided = 0 group by e.encounter_type </sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>location</string>\n            <string>${location}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:34', 2, NULL, NULL, 0, NULL, NULL, NULL, 'd39509bc-4881-11e7-a919-92ebcb67fe33'),
