(6, 'List of Diagnosis', 'List all diagnosis\'s for a given date range along with the count', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451ae04-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of Diagnosis</name>\n  <description>List all diagnosis&apos;s for a given date range along with the count</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2019-05-19 07:56:34 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>listOfDiagnosis</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" retired=\"false\">\n          <name>List of Diagnosis</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT max(cn.uuid) as DiagnosisUuid , max(cn.name) as Diagnosis , count(*) as Count FROM  obs obs INNER JOIN concept_name cn ON obs.value_coded= cn.concept_id WHERE obs.concept_id = ( SELECT c.concept_id FROM concept c WHERE c.uuid=&apos;1284AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAA&apos; ) AND cn.locale=&apos;en&apos; AND cn.locale_preferred = &apos;1&apos; AND obs.date_created &gt;= :startDate AND obs.date_created &lt;= :endDate group by obs.value_coded, cn.name order by count(*) desc ;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:34', 2, NULL, NULL, 0, NULL, NULL, NULL, 'e451ae04-4881-11e7-a919-92ebcb67fe33'),
(7, 'List of New Patient Registrations', 'List all patients who have registered within since a given date', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451a9d6-4881-11e7-a919-92ebcb67fe33\" retired=\"false\">\n  <name>List of New Patient Registrations</name>\n  <description>List all patients who have registered within since a given date</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2019-05-19 07:56:34 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"6\">\n    <entry>\n      <string>newPatientRegistrations</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"7\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"8\" retired=\"false\">\n          <name>List of New Patient Registrations</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT pi.identifier as OpenMRS_ID, pn.given_name as Given_Name, pn.family_name as Family_Name, p.date_created as Created FROM patient p INNER JOIN person_name pn ON p.patient_id = pn.person_id INNER JOIN patient_identifier pi ON p.patient_id = pi.patient_id WHERE p.date_created &gt;= :startDate GROUP BY pi.patient_id ORDER BY p.patient_id desc;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\">\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:34', 2, NULL, NULL, 0, NULL, NULL, NULL, 'e451a9d6-4881-11e7-a919-92ebcb67fe33'),
(8, 'List of Patients affected by this Diagnosis', 'List all Patients\'s for a selected Diagnosis', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e451ae04-4881-11e7-a919-92ebcb67fe24\" retired=\"false\">\n  <name>List of Patients affected by this Diagnosis</name>\n  <description>List all Patients&apos;s for a selected Diagnosis</description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2019-05-19 07:56:34 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>endDate</name>\n      <label>End date</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>diagnosisUuid</name>\n      <label>Diagnosis UUID</label>\n      <type>java.lang.String</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"8\">\n    <entry>\n      <string>listOfPatientsForDiagnosis</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"9\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"10\" retired=\"false\">\n          <name>List of Patients affected by this Diagnosis</name>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT max(obs.person_id) as PersonId, max(person.uuid) as PersonUuid, (select identifier from patient_identifier where patient_id = max(encounter.patient_id) and preferred=true limit 0,1) as &apos;OpenMRS ID&apos;, CONCAT(max(person_name.given_name),&apos; &apos;, max(person_name.middle_name), &apos; &apos;, max(person_name.family_name)) as &apos;Patient Name&apos;, IF(max(person.gender)=&apos;M&apos;, &apos;Male&apos;, &apos;Female&apos;) as Gender, max(encounter.encounter_datetime) as &apos;Encounter Date&apos;, count(*) as &apos;Total Encounters&apos; FROM  obs obs INNER JOIN concept_name cn ON obs.value_coded= cn.concept_id INNER JOIN encounter encounter ON encounter.encounter_id = obs.encounter_id INNER JOIN person person ON person.person_id = obs.person_id INNER JOIN person_name person_name on person.person_id = person_name.person_id WHERE cn.locale=&apos;en&apos; AND cn.locale_preferred = &apos;1&apos; AND cn.uuid = :diagnosisUuid AND obs.date_created &gt;= :startDate AND obs.date_created &lt;= :endDate group by person.uuid order by count(*) DESC limit 0,30;</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"11\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>diagnosisUuid</string>\n            <string>${diagnosisUuid}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:34', 2, NULL, NULL, 0, NULL, NULL, NULL, 'e451ae04-4881-11e7-a919-92ebcb67fe24'),
