ery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-05-19 00:56:34', 2, NULL, NULL, 0, NULL, NULL, NULL, '9667ac52-4881-11e7-a919-92ebcb67fe33'),
