(15, 'Bill Report', 'Bill report description', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.report.definition.ReportDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"403c09d4-36d8-45a2-a3e8-adf997413583\" retired=\"false\">\n  <name>Bill Report</name>\n  <description>Bill report description</description>\n  <creator id=\"2\" uuid=\"62ceda0f-7a0a-11e9-9534-509a4c2a2c1f\"/>\n  <dateCreated id=\"3\">2019-06-23 05:31:34 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-06 11:03:49 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>patientId</name>\n      <label>Patient ID</label>\n      <type>org.openmrs.Patient</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>15</id>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>SQL-Data-Set-for-Bill-Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" uuid=\"e6d0d35d-9cc0-48e4-a35f-ae61695e5a56\"/>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>patientId</string>\n            <string>${patientId}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>', '2019-06-22 22:31:34', 1, '2019-07-06 04:03:49', 1, 0, NULL, NULL, NULL, '403c09d4-36d8-45a2-a3e8-adf997413583'),
(17, 'SQL Data Set for Bill Report', 'This is the description of Billing report sql Dataset', 'org.openmrs.module.reporting.dataset.definition.DataSetDefinition', 'org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition', 'org.openmrs.module.reporting.serializer.ReportingSerializer', '<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"e6d0d35d-9cc0-48e4-a35f-ae61695e5a56\" retired=\"false\">\n  <name>SQL Data Set for Bill Report</name>\n  <description>This is the description of Billing report sql Dataset</description>\n  <creator id=\"2\" uuid=\"62ceda0f-7a0a-11e9-9534-509a4c2a2c1f\"/>\n  <dateCreated id=\"3\">2019-06-23 05:41:01 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2019-07-06 11:09:26 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>patientId</name>\n      <label>Patient ID</label>\n      <type>org.openmrs.Patient</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>17</id>\n  <sqlQuery>SELECT GROUP_CONCAT(patient_identifier.identifier SEPARATOR &apos;,&apos;) as reg_nos, &#xd;\n(SELECT identifier FROM patient_identifier WHERE patient_identifier.patient_id = person.person_id AND identifier_type=1 AND voided=0 AND preferred=1) AS identifier1, &#xd;\n(SELECT identifier FROM patient_identifier WHERE patient_identifier.patient_id = person.person_id AND identifier_type=2 AND voided=0 AND preferred=1) AS identifier2, &#xd;\n(SELECT identifier FROM patient_identifier WHERE patient_identifier.patient_id = person.person_id AND identifier_type=3 AND voided=0 AND preferred=1) AS identifier3,&#xd;\nDATE(person.date_created) AS register_date, given_name, family_name, &#xd;\nCONCAT(family_name, &apos;, &apos;, given_name) AS fullname, birthdate, gender,&#xd;\n(select person_attribute.value from person_attribute where person_attribute_type_id=11 and &#xd;\nperson_attribute.person_id=person.person_id) AS fathername,&#xd;\n(select person_attribute.value from person_attribute where person_attribute_type_id=4 and &#xd;\nperson_attribute.person_id=person.person_id ) AS mothername,&#xd;\n(select CONCAT(person_address.address1, &apos;, &apos;, person_address.address2&#xd;\n, &apos;, &apos;, person_address.city_village, &apos;, &apos;, person_address.state_province, &apos;, &apos;, person_address.country) From person_address where person_address.person_id=person.person_id) as address,&#xd;\n&#xd;\n&#xd;\n&#xd;\n(select value_numeric from obs where concept_id = 165100 and person_id = person.person_id LIMIT 1) as payment,&#xd;\n(select value_coded from obs where concept_id = 165097 and person_id = person.person_id LIMIT 1) as Patient_Type&#xd;\n&#xd;\nFROM person, person_name, patient_identifier&#xd;\nWHERE person.person_id = :patientId&#xd;\nAND person.person_id=person_name.person_id&#xd;\nAND person.person_id=patient_identifier.patient_id&#xd;\nAND person.voided=0&#xd;\nAND person_name.voided=0&#xd;\nAND patient_identifier.voided=0&#xd;\nAND person_name.preferred=1&#xd;\nAND patient_identifier.preferred=1&#xd;\nAND patient_identifier.identifier_type=3&#xd;\nLIMIT 1</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>', '2019-06-22 22:41:01', 1, '2019-07-06 04:09:26', 1, 0, NULL, NULL, NULL, 'e6d0d35d-9cc0-48e4-a35f-ae61695e5a56'),
